import Test from './Test';
import React, {useState} from 'react';
import "./Navbar.css";
import { BrowserRouter , Route, Routes, Link } from 'react-router-dom';
import Home from "./Home";
import About from "./About";
import Collection from "./Collection";
import Cols from "./Cols";
import Account from "./Account";



import Services from "./Services";
import Contact from "./Contact";
import "./body.css";
import Bkprofile from './Bkprofile';
import TesterApp from "./TesterSearchBar";
import BookDetails from "./BookDetails";



const Body = () => {

  const [results, setResults] = useState([]);


  return (
    <div className="body">

    <Routes>
    <Route path="/" element={<Home />} />
    <Route path="/about" element={<About />}/>
    <Route path="/collection" element={<Cols />}/>  
    <Route path="/account" element={<Account />}/>  
    <Route path="/book/:id" element={<BookDetails />}/>  

    <Route path="/testerapp" element={<TesterApp />}/>  
    <Route path="/test" element={<Test setResponse={setResults} />}/>  
    <Route path="/bar" element={<TesterResultsList results={results}  />}/>  






   
    </Routes>

    </div>

    )
}

export default Body
